    <script>
        const initWebApp = () => {
            const FULLSCREEN_ALLOWED_PLATFORMS = ['ios', 'android']
            const webApp = window?.Telegram?.WebApp

            if (webApp) {
                webApp.expand()

                const withFullScreen =
                    Number(webApp.version) >= 8 &&
                    webApp.requestFullscreen &&
                    FULLSCREEN_ALLOWED_PLATFORMS.includes(webApp.platform)

                if (withFullScreen) {
                    webApp.requestFullscreen()
                }

                webApp.requestWriteAccess()
                webApp.disableVerticalSwipes()

                return true
            }
            return false
        }

        if (!initWebApp()) {
            const observer = new MutationObserver(() => {
                if (initWebApp()) {
                    observer.disconnect()
                }
            })
            observer.observe(document, {
                childList: true,
                subtree: true
            })
            setTimeout(() => {
                initWebApp()
                observer.disconnect()
            }, 1000)
        }
    </script>
